package TxBuild;
import java.io.BufferedWriter;
import java.io.ByteArrayInputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileWriter;
import java.util.Base64;
import javax.sound.sampled.AudioSystem;
import javax.sound.sampled.Clip;



/**************************************************************
 * Diese statische Klasse spielt Audio (.wav) Datein ab
 *************************************************************/



public class Audio 
{

	
	
	
	
	// Diese Main-Methode ist nur zum Erstellen/Codieren neuer Sounds da.
	// Wenn ein neuer Sound codiert werden soll, muss die "meinSound.wav" Daei im Sound ordner liegen.
	// Nach dem Ausführen, wird eine "meinSound.txt" Datei erzeugt.
	// Diese Datei enthält dann den Base64 Sound-String, der dann unten hineinkopiert werden kann.
	public static void main(String[] args) throws Exception 
	{
		File soundFile = new File("sounds/meinSound.wav");
		byte[] b = new byte[(int) soundFile.length()];
		FileInputStream fs = new FileInputStream(soundFile);
		fs.read(b);
		fs.close();
		String str=  Base64.getEncoder().encodeToString(b);
		BufferedWriter br = new BufferedWriter(new FileWriter("sounds/meinSound.txt"));
		br.write(str);
		br.close();
		System.out.println("Sound-Datei als .txt. gespeichert.");
	}
	
	
	
	
	// Transaktion erfolgreich versendet Sound:
	private static String bitcoinTx = ""; // hier wird später mein Sound codiert.

	
	
	
	
	/** Spielt die Sountdatei mit dem Namen "title" ab.  **/
	public static void play(String title)
	{
		try
		{
			switch (title) 
			{
				case "bitcoinTx":	
				{ 	 			
					byte[] decodedSound = Base64.getDecoder().decode(bitcoinTx);
                    ByteArrayInputStream b = new ByteArrayInputStream(decodedSound);
                    Clip sound1 = AudioSystem.getClip();
                    sound1.open(AudioSystem.getAudioInputStream(b));
                    sound1.setMicrosecondPosition(0); sound1.start(); break;
					
				
//					 Wenn der Sound direkt von einer Datei kommt:				
//					Clip sound1 = AudioSystem.getClip();
//					sound1.open(AudioSystem.getAudioInputStream(new File("meinSound.wav")));		
//					sound1.setMicrosecondPosition(0); sound1.start();  break;   	
				}
			}
		}
		catch(Exception e) {System.err.println(e.getMessage());}		
	}
	

}